import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  margin-top: 60px;
  margin-left: 227px;
`;

const Title = styled.h2`
  font-family: Lato;
  font-size: 30px;
  font-weight: 800;
  line-height: 30px;
`;

const Card = styled.div`
  width: 237px;
  height: 298px;
`;

const Movies = () => {
  return (
    <Wrapper>
      <Card>
        <Title>Movies</Title>
      </Card>
    </Wrapper>
  );
};

export default Movies;
